pragma solidity >0.5.0;
pragma experimental ABIEncoderV2;
contract registry {
    
    enum flatStatus{
        forSell,
        underInspection,
        noSell
    }

    struct flat{
        uint id;
        address owner;
        string name;
        string addr;
        uint price;
        uint bedRooms;
        uint bathRooms;
        uint squareFeet;
        uint yearBuilt;
        string photos;
        flatStatus status;
        address buyer;
    }

    flat[] public flats;

    function addFlat(string memory _name, string memory _addr, uint _price, uint _beds, uint _baths, uint _sqft, uint _year, string memory _photos) public{
        uint id = flats.length;
        flats.push(flat(id, msg.sender, _name, _addr, _price, _beds, _baths, _sqft, _year, _photos, flatStatus.forSell, 0x0000000000000000000000000000000000000000));
    }

    function getFlats() public view returns(flat[] memory){
        return flats;
    }

    function buy(uint _id) public{

        flats[_id].buyer = msg.sender;
        flats[_id].status = flatStatus.underInspection;
    }

    function sell(uint _id) public{
        flats[_id].owner = flats[_id].buyer;
        flats[_id].buyer = 0x0000000000000000000000000000000000000000;
        flats[_id].status = flatStatus.noSell;
    }

    function makeForSell(uint _id) public returns(bool){
        if(msg.sender == flats[_id].owner){
            flats[_id].status = flatStatus.forSell;
            return true;
        }
        return false;
    }

    // to destroy deployed contract
    address payable contractOwner;
    function destroy() public{
        selfdestruct(contractOwner);
    }

    constructor() public {

        contractOwner = address(uint160(0xa802beaE0c5C90E96241Fd0000c7c258de131080));

        flats.push(flat(0, 0x95c942cE0BD7a66D6b9515E13fAC1d5da8A5FF5E, "NYC Penthouse", "157 W 57th st APT 498, New York, NY 10010", 20, 2, 3, 2200, 2013, "https://bafybeicnfis7cygxogv65pmmsazjpyet4mhesiqg3tkwysfbg4wz3cdira.ipfs.w3s.link/apartment_3.jpg", flatStatus.forSell, 0x0000000000000000000000000000000000000000));

        flats.push(flat(1, 0xB355378d82825aC7cF1ac96E837Fd712cF7721d1, "", "70780 Tamarisk Ln, Rancho Mirage, CA 92270", 15, 4, 4, 3979, 2010, "https://bafybeifb4gv7ncth3mxl2fopmlqglgljwfhtgmytxihkyoolyraewi3hdi.ipfs.w3s.link/apartment_2.jpg", flatStatus.forSell, 0x0000000000000000000000000000000000000000));

        flats.push(flat(2, 0x47aFBc529162dbE9FDFAa373A78c65a86E550A50, "Driven Woods", "183 Woodland Drive, Camano Island, WA 98282", 10, 3, 3, 2202, 2016, "https://bafybeiadgdon7fibqgdrmewjv25cv7ltvkk42wrivasqf2fbrzezqh36k4.ipfs.w3s.link/apartment_1.jpg", flatStatus.forSell, 0x0000000000000000000000000000000000000000));
    }
}
